patch:
--- lib/primesieve/include/primesieve/iterator.h
@@ -26,6 +26,20 @@
 #include <stdint.h>
 #include <stddef.h>

+#if __cplusplus >= 202002L && \
+    defined(__has_cpp_attribute)
+  #if __has_cpp_attribute(unlikely)
+    #define IF_UNLIKELY_PRIMESIEVE(x) if (x) [[unlikely]]
+  #endif
+#elif defined(__has_builtin)
+  #if __has_builtin(__builtin_expect)
+    #define IF_UNLIKELY_PRIMESIEVE(x) if (__builtin_expect(!!(x), 0))
+  #endif
+#endif
+#if !defined(IF_UNLIKELY_PRIMESIEVE)
+  #define IF_UNLIKELY_PRIMESIEVE(x) if (x)
+#endif
+
 #ifdef __cplusplus
 extern "C" {
 #endif
@@ -81,7 +95,8 @@ void primesieve_generate_prev_primes(primesieve_iterator*);
  */
 static inline uint64_t primesieve_next_prime(primesieve_iterator* it)
 {
-  if (++(it->i) >= it->size)
+  it->i += 1;
+  IF_UNLIKELY_PRIMESIEVE(it->i >= it->size)
     primesieve_generate_next_primes(it);
   return it->primes[it->i];
 }
@@ -96,8 +111,9 @@ static inline uint64_t primesieve_next_prime(primesieve_iterator* it)
  */
 static inline uint64_t primesieve_prev_prime(primesieve_iterator* it)
 {
-  if (it->i-- == 0)
+  IF_UNLIKELY_PRIMESIEVE(it->i == 0)
     primesieve_generate_prev_primes(it);
+  it->i -= 1;
   return it->primes[it->i];
 }

--- lib/primesieve/include/primesieve/iterator.hpp
@@ -16,6 +16,20 @@
 #include <cstddef>
 #include <limits>

+#if __cplusplus >= 202002L && \
+    defined(__has_cpp_attribute)
+  #if __has_cpp_attribute(unlikely)
+    #define IF_UNLIKELY_PRIMESIEVE(x) if (x) [[unlikely]]
+  #endif
+#elif defined(__has_builtin)
+  #if __has_builtin(__builtin_expect)
+    #define IF_UNLIKELY_PRIMESIEVE(x) if (__builtin_expect(!!(x), 0))
+  #endif
+#endif
+#if !defined(IF_UNLIKELY_PRIMESIEVE)
+  #define IF_UNLIKELY_PRIMESIEVE(x) if (x)
+#endif
+
 namespace primesieve {

 /// primesieve::iterator allows to easily iterate over primes both
@@ -76,7 +90,8 @@ struct iterator
   ///
   uint64_t next_prime()
   {
-    if (++i_ >= size_)
+    i_ += 1;
+    IF_UNLIKELY_PRIMESIEVE(i_ >= size_)
       generate_next_primes();
     return primes_[i_];
   }
@@ -89,8 +104,9 @@ struct iterator
   ///
   uint64_t prev_prime()
   {
-    if (i_-- == 0)
+    IF_UNLIKELY_PRIMESIEVE(i_ == 0)
       generate_prev_primes();
+    i_ -= 1;
     return primes_[i_];
   }

--- lib/primesieve/src/iterator-c.cpp
@@ -137,8 +137,8 @@ void primesieve_generate_next_primes(primesieve_iterator* it)
   }

   auto& primes = getPrimes(it);
-  it->i = 0;
   it->primes = &primes[0];
+  it->i = 0;
 }

 void primesieve_generate_prev_primes(primesieve_iterator* it)
@@ -188,6 +188,6 @@ void primesieve_generate_prev_primes(primesieve_iterator* it)
   }

   auto& primes = getPrimes(it);
-  it->i = it->size - 1;
   it->primes = &primes[0];
+  it->i = it->size;
 }
--- lib/primesieve/src/iterator.cpp
@@ -200,7 +200,7 @@ void iterator::generate_prev_primes()
     primeGenerator.fillPrevPrimes(primes, &size_);
   }

-  i_ = size_ - 1;
+  i_ = size_;
   primes_ = &primes[0];
 }

